export const authInterceptor = (req, next) => {
  const token = localStorage.getItem('token');
  if (!token) {
    return next(req.clone({
      withCredentials: true
    }));
  }
  return next(req.clone({
    withCredentials: true,
    setHeaders: {
      Authorization: `Bearer ${token}`
    }
  }));
};
